import React, { Component } from 'react';
import { Card } from 'semantic-ui-react'

class UserCard extends Component {
	constructor(){
		super()
	}

	render(){
		console.log(this.props)
		return(
			<Card>
				<Card.Content>
					<p> {this.props.username} </p>
				</Card.Content>
			</Card>
			)
	}
}

export default UserCard;
